#Сюда посылку до первых единиц паузы между пакетами
trx = ""

i = 0
while i < len(trx):
    if (not(i % 11)):
        curent_str_byte = trx[i+1 : i + 9] #отбрасываем стартовый бит и 2 стоповых бита
        print(chr(int(curent_str_byte[::-1],2)), end="") #переворачиваем и превращаем из строки битов в ASCII символ, через промежуточный каст к int
    i += 1

#На выходе вот такой парс
